            <div className="absolute inset-0 w-screen h-screen flex items-center justify-center transition-all ease-in-out duration-1000 transform translate-x-0 slide">
              <img
                src="/images/image1.jpg"
                alt="Tajmahal"
                // className="w-full rounded-2xl"
              ></img>
            </div>
